import { memo } from "react";
import { useLocation, useParams } from "react-router";

import * as S from "./Project.styled";

export const Project: React.FC = memo(() => {
	const { id } = useParams();

	return (
		<S.Project>
			<S.Title></S.Title>
			<S.Description></S.Description>
		</S.Project>
	);
});
